INSERT INTO `titles` VALUES ('0047d26457fdb00cedb03298f3507228',111161,'The Shawshank Redemption',1994,'http://ia.media-imdb.com/images/M/MV5BMTYzMzA2Nzc2Nl5BMl5BanBnXkFtZTcwMzQwMTgxMQ@@._V1._SX78_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm1818789888/tt0111161','/video/screenplay/vi415302425/',0.92,458831,NULL,NULL,NULL,'1995-03-01','1 March 1995','Fear can hold you prisoner. Hope can set you free.','Two imprisoned men bond over a number of years, finding solace and eventual redemption through acts of common decency.','Nominated for 7 Oscars. Another 11 wins & 13 nominations','Rita Hayworth and the Shawshank Redemption (USA) (working title)',142,'Color (Technicolor)','1.85 : 1','R','At the end of the movie, there is a dedication to Allen Greene. He was Frank Darabont\'s agent and also a close personal friend. He died just before the completion of the movie due to AIDS complications.','Continuity: When Andy comes out of the cell in his first morning in prison, Red is shown wearing a shirt with a number that begins with 311, not beginning with a 302 which is the number on his shirt in the rest of the movie.'),('0163a27a977adac18473999cac076658',61811,'In the Heat of the Night',1967,'http://ia.media-imdb.com/images/M/MV5BMTg5MTEwODM4NV5BMl5BanBnXkFtZTYwNDIyNDk5._V1._SX98_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm1702402048/tt0061811','/video/imdblink/vi763757849/',0.81,21023,NULL,NULL,NULL,'1968-03-01','1 March 1968','They got a murder on their hands . . . they don\'t know what to do with it.','An African American detective is asked to investigate a murder in a racist southern town.','Won 5 Oscars. Another 17 wins & 12 nominations',NULL,109,'Color','1.85 : 1','Approved','The scene that took place at the sheriff\'s house featured dialog that came out of improvisations between Sidney Poitier and Rod Steiger.','Revealing mistakes: It\'s still early morning when Harvey Oberst is running for Arkansas (Tibbs wants to catch the noon train). The sun should be on his back, not his face on the bridge.'),('02040ed2a39a9e9edb0815fb957b7cea',369702,'Mar adentro',2004,'http://ia.media-imdb.com/images/M/MV5BMjA5NTgwMjc0MV5BMl5BanBnXkFtZTcwMjM0NDcyMQ@@._V1._SX95_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm1905952768/tt0369702','/video/screenplay/vi3237151001/',0.81,22141,NULL,NULL,NULL,'2005-02-02','2 February 2005',NULL,'The real-life story of Spaniard Ramon Sampedro, who fought a 30 year campaign in favor of euthanasia and his own right to die.','Won Oscar. Another 60 wins & 30 nominations','The Sea Inside (International: English title) (UK) (USA)@#@Mare dentro (Italy)@#@The Sea Within (Europe: English title)',125,'Color','2.35 : 1','PG-13','This is the second Spanish movie about Ramon Sampedro\'s life. The first one was Condenado a vivir (2001) (TV).',NULL),('020c5174996895df41f06493f7b817df',56172,'Lawrence of Arabia',1962,'http://ia.media-imdb.com/images/M/MV5BMzAwMjM4NzA2OV5BMl5BanBnXkFtZTcwMDI0NzAwMQ@@._V1._SX95_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm37328896/tt0056172','/video/imdb/vi1481310233/',0.86,73336,NULL,NULL,NULL,'1963-03-15','15 March 1963','The Desert Classic. (1983 Video Release)','Epic rumination on a flamboyant and controversial British military figure and his conflicted loyalties during wartime service.','Won 7 Oscars. Another 19 wins & 12 nominations',NULL,216,'Color (Technicolor)','2.35 : 1','Approved','Anthony Quayle thought the character of Colonel Brighton was an idiot but David Lean told him Brighton was the only honorable character in the film.','Anachronisms: In his interview of Feisal, Jackson Bentley mentions that \"certain influential men\" in America want their country to join World War I. However, this conversation occurs after the fall of Aqaba, which was in July 1917; by that time, the US had already been in the war for several months.'),('031d770fc7349db7b06d141e58a8463c',107048,'Groundhog Day',1993,'http://ia.media-imdb.com/images/M/MV5BMTU0OTQyMDMxNl5BMl5BanBnXkFtZTcwODc3Mjc1MQ@@._V1._SX100_SY135_.jpg','/rg/photos-title/poster-1/media/rm920297216/tt0107048','/video/screenplay/vi1709376281/',0.81,121363,NULL,NULL,NULL,'1993-07-28','28 July 1993','He\'s having the worst day of his life... over, and over...','A weatherman finds himself living the same day over and over again.','Won BAFTA Film Award. Another 5 wins & 7 nominations',NULL,101,'Color (Technicolor)','1.85 : 1','PG','The lines Andie MacDowell quotes in the café - \"unwept, unhonoured, and unsung\" - are from Sir Walter Scott\'s \"Lay of the Last Minstrel\", Canto vi, Stanza 1, which begins with the famous line, \"Breathes there a man with soul so dead...','Factual errors: In the beginning of the movie when Phil is reading the weather forecast. We can clearly see him standing almost against the blue screen which casts a very strong shadow. Yet in the preview window he appears clear on the projected background. In reality Bill Murray\'s shadow would have cast a terrible blue screen shadow that would have been impossible to remove using the chroma key.'),('03ddf7c6df4d07020bf4ac7c88c3945c',347149,'Hauru no ugoku shiro',2004,'http://ia.media-imdb.com/images/M/MV5BMTMzODM0NDQ2N15BMl5BanBnXkFtZTcwNDA5MzMzMQ@@._V1._SX100_SY140_.jpg','/rg/photos-title/unknown-1/media/rm1235458304/tt0347149','/video/screenplay/vi2391802137/',0.81,39095,NULL,NULL,NULL,'2005-01-12','12 January 2005',NULL,'When an unconfident young woman is cursed with an old body by a spiteful witch, her only chance of breaking the spell lies with a self-indulgent yet insecure young wizard and his companions in his legged, walking home.','Nominated for Oscar. Another 8 wins & 13 nominations','Howl\'s Moving Castle (International: English title) (UK) (USA)',119,'Color','1.85 : 1','TV-PG','The license number on the first car Sofie\'s mother rides is 667.',NULL),('03d0af9423d8a89edbec02fe59987a2f',81505,'The Shining',1980,'http://ia.media-imdb.com/images/M/MV5BMTQ1NTYxOTM5OV5BMl5BanBnXkFtZTYwMzM1Mjc4._V1._SX90_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm3631716352/tt0081505','/video/screenplay/vi1660224281/',0.85,160156,NULL,NULL,NULL,'1980-10-16','16 October 1980','The tide of terror that swept America IS HERE[UK Poster]','A family heads to an isolated hotel for the winter where an evil and spiritual presence influences the father into violence, while his psychic son sees horrific forebodings from the past and of the future.','1 win & 5 nominations','Stanley Kubrick\'s \'The Shining\'',142,'Color','1.37 : 1','R','The two tracked vehicles in the movie are the Activ Fischer VW Powered 4 Speed Snow-Trak (referred to and labeled on the vehicle as a \"SnowCat\") and a Thiokol Imp Snow-Cat (this is the vehicle Wendy and Danny escape in).','Continuity: When Jack talks with Lloyd the bartender for the first time, you can see 2 errors: the pattern of the bar is lighted glass, wood and then lighted glass again. you can see that at the beginning, Jack sits and the wood part is right in the center of his body, one moment later it\'s near his left hand, and few moments later it\'s far away from his left hand.'),('043beed9d7d749a680226675ec510c0a',365748,'Shaun of the Dead',2004,'http://ia.media-imdb.com/images/M/MV5BNDcxMDk3Mjg4OV5BMl5BanBnXkFtZTcwNTc4NzYyMQ@@._V1._SX94_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm847616256/tt0365748','/video/screenplay/vi2172780825/',0.80,117152,NULL,NULL,NULL,'2005-07-27','27 July 2005','It\'s just one of those days when you\'re feeling a little...dead.','A man decides to turn his moribund life around by winning back his ex-girlfriend, reconciling his relationship with his mother, and dealing with an entire community that has returned from the dead to eat the living.','6 wins & 16 nominations','Shaun of the Dead (France)@#@Tea-Time of the Dead (UK) (working title)',99,'Color','2.35 : 1','R','The non-featured zombie extras were paid the princely sum of £1 a day for their troubles.','Errors made by characters (possibly deliberate errors by