ard.'),('0617aa618751e18e25bd34ce4cc20caa',44741,'Ikiru',1952,'http://ia.media-imdb.com/images/M/MV5BMTcyMDU0MTQzNV5BMl5BanBnXkFtZTcwOTk2NDQyMQ@@._V1._SX99_SY140_.jpg','/rg/photos-title/product-1/media/rm864980480/tt0044741',NULL,0.81,14462,NULL,NULL,NULL,'1956-03-25','25 March 1956',NULL,'Kanji Watanabe is a longtime bureaucrat in a city office who, along with the rest of the office, spends his entire working life doing nothing...','Nominated for BAFTA Film Award. Another 5 wins','Doomed@#@Living (International: English title) (informal English title)@#@To Live (International: English title) (informal English title)',143,'Black and White','1.37 : 1','Not','The only Akira Kurosawa film between Yoidore tenshi (Drunken Angel) and Akahige (Red Beard) not to feature \'Toshiro Mifune\'.','Revealing mistakes: A beer sign is backwards in a bar scene, revealing the use of a mirror image.'),('0752ed6f9c29dd2897e369410c7ae169',95953,'Rain Man',1988,'http://ia.media-imdb.com/images/M/MV5BNzk3MzI5NTE4N15BMl5BanBnXkFtZTcwOTk3NTQyMQ@@._V1._SX100_SY132_.jpg','/rg/photos-title/poster-1/media/rm150706688/tt0095953','/video/imdblink/vi278332441/',0.80,94316,NULL,NULL,NULL,'1989-03-15','15 March 1989',NULL,'Selfish yuppie Charlie Babbitt\'s father left a fortune to his savant brother Raymond and a pittance to Charlie; they travel cross-country.','Won 4 Oscars. Another 19 wins & 13 nominations',NULL,133,'Color','1.85 : 1','R','Ronald Bass\'s first involvement with the film (when Martin Brest was attached) all took place over the phone as he was suffering from adult chicken pox at the time. As both Brest and Dustin Hoffman\'s wives were pregnant at the time, no one actually wanted to sit down for a face-to-face meeting with him.','Errors made by characters (possibly deliberate errors by the filmmakers): While watching Charlie play blackjack, one of the casino security officers says that \"no one can count through a six deck shoe\". In fact, this is quite possible for someone with just basic math skills to do using the \"hi-lo\" counting method. A security officer of any major casino should know this.'),('0994fe68577bbe9fc3c18f2ff4e11701',140352,'The Insider',1999,'http://ia.media-imdb.com/images/M/MV5BMjA1MDQ1MjMyOV5BMl5BanBnXkFtZTcwMjU5OTIyMQ@@._V1._SX98_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm4259813632/tt0140352','/video/screenplay/vi1173618969/',0.80,64015,NULL,NULL,NULL,'2000-03-15','15 March 2000','Warning: Exposing the Truth May Be Hazardous','A research chemist comes under personal and professional attack when he decides to appear in a \"60 Minutes\" expose on Big Tobacco.','Nominated for 7 Oscars. Another 21 wins & 34 nominations','60 Minutes (USA) (pre-release title)@#@Man of the People (USA) (working title)@#@The Untitled Tobacco Project (USA) (working title)@#@Untitled Michael Mann Film (USA) (working title)',157,'Color','2.35 : 1','R','After reading an early draft of The Good Shepherd (2006), Michael Mann approached Eric Roth to help write the script.','Anachronisms: Jeffrey Wigand was fired in March 1993. In the movie he is driving an Audi A4. Audi didn\'t have a model called A4 until 1995. Further, the model shown is a 1998.'),('0b2a21555799720cc909cca3cd06f8bd',17136,'Metropolis',1927,'http://ia.media-imdb.com/images/M/MV5BMTI2ODk3ODIzNV5BMl5BanBnXkFtZTcwMDk0MTYxMQ@@._V1._SX100_SY135_.jpg','/rg/photos-title/product-1/media/rm2666563584/tt0017136','/video/imdblink/vi3197895705/',0.84,35334,NULL,NULL,NULL,'1927-03-13','13 March 1927','There can be no understanding between the hands and the brain unless the heart acts as mediator.','In a futuristic city sharply divided between the working class and the city planners, the son of the city\'s mastermind falls in love with a working class prophet who predicts the coming of a savior to mediate their differences.','2 wins & 2 nominations',NULL,153,'Black and White (tinted)','1.33 : 1',NULL,'For decades, all that survived of \"Metropolis\" were an incomplete original negative and copies of shortened, re-edited release prints; over a quarter of the film was believed lost. However, in July 2008 Germany\'s \'ZEITmagazin\' reported the discovery of a copy of the original, full-length print which had been sent to Argentina in 1928. Examining the reels in Buenos Aires, cinema experts realised that they contained the missing sequences (predominantly those involving the Thin Man who spies on Freder, and worker 11811 in Yoshiwara). Additionally, in October 2008 it was announced that another (hopefully) early copy in the obsolete 9.5mm format had been held in the University of Chile\'s film library, intentionally mislabelled to avoid destruction during 1973\'s military coup. It is as yet unknown if this holds any further viewable footage. After almost 80 years, the film is now hoped to be complete.','Revealing mistakes: Fritz Lang shot more than one version of this movie. There are differences between the version on the Madacy DVD and the Kino DVD. In the Kino DVD, Freder exits the Moloch machine hall in chapter 7 (at 15:55). The shot of Freder descending the stairs is missing two motorized utility carts. These appear in the Madacy Video DVD in Chapter 3 (at 14:24).'),('0bdcc12af0f8834e7b332c20d7b59435',378194,'Kill Bill: Vol. 2',2004,'http://ia.media-imdb.com/images/M/MV5BMTIwNzQ3MDIxMV5BMl5BanBnXkFtZTcwMDIxMzUyMQ@@._V1._SX95_SY140_.jpg','/rg/photos-title/event-1/media/rm3345062400/tt0378194','/video/screenplay/vi405667865/',0.80,164215,NULL,NULL,NULL,'2004-05-17','17 May 2004','Revenge is a dish best served cold.','The murderous Bride continues her vengeance quest against her ex-boss, Bill, and his two remaining associates; his younger brother Budd, and Bill\'s latest flame Elle.','Nominated for 2 Golden Globes. Another 9 wins & 38 nominations','Kill Bill (USA) (closing credits title)@#@Kill Bill Part 2 (USA) (informal title)@#@Vol. 2 (USA)',136,'Black and White | Color','1.33 : 1','R','Pulp Fiction (1994) references: In the flashback scene when the Bride finds out she\'s pregnant, and the assassin and her are at a stand off, The Bride says that she is the \"deadliest women in the world\". In the \"Fox Force 5\" pilot, Uma Thurman\'s character is said to be the \"deadliest women in the world with a knife\".','Factual errors: The Black Mamba snake that causes Bud\'s death was black in color. In reality, its body is not black at all; the name is given to it because of its inky black mouth. Normally, Mambas have a dark olive, olive green, gray brown, or metal color. Some of them have a light band around their body.'),('0bb170c7b3337ae3800a165b353169d7',121955,'South Park',1997,'http://ia.media-imdb.com/images/M/MV5BMTI5MTYyNDU3NF5BMl5BanBnXkFtZTYwNjU1MzM5._V1._SX100_SY132_.jpg','/rg/photos-title/still_frame-1/media/rm2024310784/tt0121955','/video/comedycentral/vi2313356313/',0.93,39940,1,NULL,NULL,'1998-07-17','17 July 1998','Four boys. One f**ked up town.','Follows the misadventures of four irreverent grade-schoolers in the quiet, dysfunctional town of South Park, Colorado.','Won 4 Primetime Emmys. Another 4 wins & 16 nominations',NULL,30,'Color','1.33 : 1','TV-14','The characters of Terrance and Phillip were created because Trey Parker and Matt Stone kept getting complaints about the show being \"nothing but bad animation and fart jokes\".','Continuity: Clyde\'s last name was Goodman in early seasons, but the more recent seasons changed it to Harris. In early merchandise and the season eight episode quest for ratings he was called Clyde Donovan. Also, Jimmy\'s last name has been both Vollmer or Swanson.'),('0c99a4e45ba6cc105dff56758af810c8',118799,'La vita è bella',1997,'http://ia.media-imdb.com/images/M/MV5BNjMyNjA0NzIwN15BMl5BanBnXkFtZTcwODU1NDMzMQ@@._V1._SX98_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm3822229760/tt0118799','/video/imdblink/vi3297969177/',0.84,96805,NULL,NULL,NULL,'1998-10-21','21 October 1998','An unforgettable fable that proves love, family and imagination conquer all.','A Jewish 