 (South Africa: English title) (informal alternative title) (USA) (syndication title)@#@C.S.I. (USA) (short title)@#@CSI: Weekends (USA) (promotional title)@#@Les experts (Canada: French title)',60,'Color','1.78 : 1','TV-PG','The producers wanted to hire Katee Sackhoff to replace Jorja Fox when she left the show, but the executives at CBS and Jerry Bruckheimer Television overruled the decision.','Factual errors: In the opening credits of Season 1, there is a quick glimpse of someone (probably Warrick Brown) playing blackjack. Three sets of cards are visible - the one in the player\'s hand, scratching the table (calling for a hit) and two hands immediately to that player\'s left. Because blackjack is played from the dealer\'s left to right, the two hands to the player\'s left have not yet been played, yet the cards are face-down between their respective bets and the dealer. In a real game, the cards would have been dealt on the far side of the chips (toward the player). If the hands were in play, the cards would either be in the player\'s hand or under the chips (indicating a stand). As it is, the cards would never be in the position they are in. (Even if Warrick were playing all three of the hands, they would be dealt in alternating location - one in front of the chips and the next behind, never two consecutive hands in front of the chips.) Also, one of the hands is laid on the table such that it is partially covering its bet - something the casino would not allow because of the constant surveillance of the players\' bets.'),('312670cd8ebf11a9da46b6c59fd6e2f2',21749,'City Lights',1931,'http://ia.media-imdb.com/images/M/MV5BMTk3Nzg1MTcxN15BMl5BanBnXkFtZTcwNjg5MDU5Mg@@._V1._SX100_SY134_.jpg','/rg/photos-title/still_frame-1/media/rm1819187456/tt0021749','/video/imdb/vi753402137/',0.86,24074,NULL,NULL,NULL,'1931-04-07','7 April 1931',NULL,'The Tramp struggles to help a blind flower girl he has fallen in love with.','1 win','City Lights: A Comedy Romance in Pantomime (US