thunder. This is a reference to a real life incident. On September 14, 1923, 82,000 people packed into New York\'s Polo Grounds to watch world heavyweight champion Jack Dempsey face Argentinean no-hoper Luis Angel Firpo. Dempsey immediately began to pummel Firpo, knocking him down seven times within the first two minutes. Somehow however, in the middle of the first round, Firpo managed to land a right uppercut with such force that it literally knocked Dempsey out of the ring. Dempsey was completely disorientated upon returning to the ring, but he managed to survive the rest of the round and regain his composure. The second round lasted less than a minute, during which time he knocked Firpo down twice; Firpo was unable to get up from the second fall.','Continuity: The number \"2\" disappears off Rocky\'s apartment door after he answers the door to let Micky in.'),('473bee808094bf9e59cd53d00959e2ef',317705,'The Incredibles',2004,'http://ia.media-imdb.com/images/M/MV5BMTgzMDY3NjAzMl5BMl5BanBnXkFtZTcwMzkxMDgyMQ@@._V1._SX99_SY140_.jpg','/rg/photos-title/publicity-1/media/rm3608975360/tt0317705','/video/screenplay/vi2311127321/',0.81,142530,NULL,NULL,NULL,'2004-11-24','24 November 2004','Do hero, ek awaaz!! (Hindi-language version)','A family of undercover superheroes, while trying to live the quiet suburban life, are forced into action to save the world.','Won 2 Oscars. Another 39 wins & 32 nominations','The Fantastics (USA) (working title)@#@The Invincibles (USA) (working title)@#@Untitled Brad Bird Pixar Project (USA) (working title)',115,'Color','2.35 : 1','PG','Metroville High School\'s mascot (that Violet Parr attends) is the Spartans, and their colors are baby blue and white, this is the same as Brad Bird\'s High School in Corvallis, Oregon.','Continuity: The position of the aftershave bottle by Frozone\'s mirror changes.'),('499336c03b5e38d296164a0efecb888c',82096,'Das Boot',1981,'http://ia.media-imdb.com/images/M/MV5BMTI1OTE4NzQ5Nl5BMl5BanBnXkFtZTcwMDUwMTYyMQ@@._