uled to take place in May. All of a sudden it was snowing.','Continuity: Early in season one Lincoln\'s execution is said to be taking place on May 11th. But shortly after the failed execution the prison is shown covered in snow.'),('5518dbf761bbb3eb1543644f73355735',98936,'Twin Peaks',1990,'http://ia.media-imdb.com/images/M/MV5BNTc3NDg5NTgyMl5BMl5BanBnXkFtZTcwMjQ0MTU1MQ@@._V1._SX95_SY134_.jpg','/rg/photos-title/still_frame-1/media/rm1894357248/tt0098936','/video/cbs/vi3305504793/',0.94,18793,1,NULL,NULL,'1991-04-15','15 April 1991','A town where everyone knows everyone and nothing is what it seems.','An idiosyncratic FBI Agent investigates the murder of a young woman in the even more idiosyncratic town of Twin Peaks.','Won 3 Golden Globes. Another 7 wins & 32 nominations',NULL,47,'Color','1.33 : 1','TV-MA','The insurance agent that comes to see Catherine concerning the forged insurance deal is named Walter Neff. The crooked insurance agent played by Fred MacMurray in Double Indemnity (1944) is also named Walter Neff.','Continuity: The fact that there was a year\'s gap between the filming of the pilot episode and the first season\'s episode is evident in the different hairstyles sported by some of the cast. Although only a night is meant to have passed between the episodes, James Hurley, Sheriff Truman, and Deputy Brennan all have shorter haircuts by the next day. Donna Hayward, Catherine Martell and Audrey Horne (in particular) all have noticeably longer hair by the next day.'),('56e14a2b8eedc51100bd80babbf2e2f1',53125,'North by Northwest',1959,'http://ia.media-imdb.com/images/M/MV5BMTc3ODIwNTg2NF5BMl5BanBnXkFtZTcwNDY3MTQ5Mg@@._V1._SX100_SY127_.jpg','/rg/photos-title/still_frame-1/media/rm1315411968/tt0053125','/video/screenplay/vi473956889/',0.86,85362,NULL,NULL,NULL,'1959-10-21','21 October 1959','Alfred Hitchcock takes you.... North by Northwest!','A hapless New York advertising executive is mistaken for a government agent by a group of foreign spies, and is pur