r, these are heavy casualties and the regiment was widely viewed as having performed bravely indeed.'),('5a6bad01a28de85913af5d4a3e606119',105695,'Unforgiven',1992,'http://ia.media-imdb.com/images/M/MV5BMTkwNDUzMjQ5MV5BMl5BanBnXkFtZTcwNTU2ODEzMQ@@._V1._SX100_SY136_.jpg','/rg/photos-title/poster-1/media/rm3522533888/tt0105695',NULL,0.83,88015,NULL,NULL,NULL,'1992-09-09','9 September 1992',NULL,'Retired Old West gunslinger William Munny reluctantly takes on one last job, with the help of his old partner and a young man.','Won 4 Oscars. Another 30 wins & 15 nominations','The Cut Whore Killings (USA) (original script title)@#@The William Munny Killings (USA) (working title)',131,'Color (Technicolor)','2.35 : 1','R','Richard Harris was watching High Plains Drifter (1973) on TV when Clint Eastwood phoned him to offer the part of English Bob.','Incorrectly regarded as goofs: English Bob says that no assassin would dare hold a gun to a monarch. There were, in fact, six assassination attempts made against Queen Victoria, and they were well known at the time. He certainly would have known about them, though it should be mentioned that he was concerned with successful attempts (looking at a monarch causes the hand \"to shake\"). However, it should be noted that English Bob was mainly saying this to antagonize people and not necessarily because he truly believed it.'),('5cd20fe1eff4a8f0a5ad123979d7de86',165581,'The King of Queens',1998,'http://ia.media-imdb.com/images/M/MV5BMTQ3MDgyNTE4OV5BMl5BanBnXkFtZTcwMjU2ODA1MQ@@._V1._SX100_SY122_.jpg','/rg/photos-title/still_frame-1/media/rm4079261696/tt0165581','/video/screenplay/vi3824419097/',0.82,10643,1,NULL,NULL,'2000-09-06','6 September 2000','Comedy That Delivers!','Delivery man Doug Heffernan has a good life: He\'s got a pretty wife (Carrie), a big TV and friends to watch it with. Then Carrie\'s goofy and annoying father Arthur moves in with them.','Nominated for Primetime Emmy. Another 14 wins & 4 nominations',NULL,22,'Color','1