dred spirit in a government agent who is exposed to their biotechnology.','Nominated for Golden Globe. Another 4 wins & 9 nominations',NULL,112,'Color','1.85 : 1','R','The idea of the prawns being obsessed with cat food came from two inspirations. In impoverished areas of Johannesburg, Neill Blomkamp would see people selling cheese poofs and other snack foods out of large 3-foot tall bags and wanted the aliens to have a similar cheap food. The decision to make them cat food came from one of the producers who used canned cat food to bait hooks when fishing for prawns in Vancouver.','Errors made by characters (possibly deliberate errors by the filmmakers): When Wikus walks into the Nigerian base, Obesandjo says he has a lot of guts for a white man. But the word he uses for \"white man\" is the Kiswahili word \"mzungu\". Kiswahili is widely spoken in East Africa, but not in South Africa or Nigeria.'),('60581523abd4d5fbba13422e3343ba1c',314979,'Battlestar Galactica',2003,'http://ia.media-imdb.com/images/M/MV5BMTY4MDU3MTQyNl5BMl5BanBnXkFtZTcwNzk5NDQyMQ@@._V1._SX93_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm2470352896/tt0314979','/video/screenplay/vi1220083993/',0.82,15118,1,NULL,NULL,'2005-01-15','15 January 2005','Never create what you can\'t control.','A re-imagining of the original series in which a \"rag-tag fugitive fleet\" of the last remnants of mankind flees pursuing robots while simultaneously searching for their true home, Earth.','Nominated for 3 Primetime Emmys. Another 2 wins & 3 nominations','Battlestar Galactica: The Miniseries (USA) (long title)',180,'Color','1.78 : 1','TV-14','The characters of Starbuck and Boomer are female in this version; they were male in the original TV series. None of the characters in the original series had last or family names.','Errors made by characters (possibly deliberate errors by the filmmakers): The Colonials have a polytheistic religion and throughout the series say \"Oh my Gods,\" yet Adama says \"Oh my God\" w