409/',0.80,104349,NULL,NULL,NULL,'2007-11-14','14 November 2007','There are two sides to the American dream.','In 1970s America, a detective works to bring down the drug empire of Frank Lucas, a heroin kingpin from Manhattan, who is smuggling the drug into the country from the Far East.','Nominated for 2 Oscars. Another 5 wins & 28 nominations','The Return of Superfly (USA) (working title)@#@Tru Blu (USA) (original script title)',157,'Color','1.85 : 1','R','When director Antoine Fuqua was attached to the project, he pursued Ray Liotta and John C. Reilly for supporting roles. This was one of many budget-related concerns that lead to Universal\'s cancellation of this production while it was under Fuqua\'s management.','Continuity: In the movie they said Stevie is a southpaw, but you can see that when he throws the ball in the backyard of Frank\'s house, he is clearly right handed.'),('6683cf398a562cdd9d31b983d511edce',482571,'The Prestige',2006,'http://ia.media-imdb.com/images/M/MV5BMjAwMDAwODg2NV5BMl5BanBnXkFtZTcwMzQ1MzczMQ@@._V1._SX95_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm2337314816/tt0482571','/video/screenplay/vi2835284761/',0.84,176699,NULL,NULL,NULL,'2006-11-15','15 November 2006','A Friendship That Became a Rivalry.','The rivalry between two magicians is exacerbated when one of them performs the ultimate illusion.','Nominated for 2 Oscars. Another 3 wins & 14 nominations',NULL,130,'Color','2.35 : 1','PG-13','Nikola Tesla was a world-renowned inventor, physicist, and engineer. For a while, he conducted electrical experiment at his lab in Colorado Springs where. He was also known for his eccentric behavior.','Plot holes: When Angier first goes up the mountain and fails to meet Tesla, he instead encounters Alley. Alley recognizes him as \"The Great d\'Anton\" whom he saw seven times in London. At the end of the encounter he says \"I\'m sorry Mr. Angier.\" How does he know d\'Anton\'s real name? Angier didn\'t introduce himself.'),('675577a572d00bfe6c4850211b9dfee1',497116,'An Inconvenient Truth',2006,'http://ia.media-imdb.com/images/M/MV5BOTg3NjYxMjM5OF5BMl5BanBnXkFtZTcwMzQzMDA0MQ@@._V1._SX95_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm2446039296/tt0497116','/video/screenplay/vi2465858329/',0.80,33100,NULL,NULL,NULL,'2006-10-11','11 October 2006','A Global Warning','A documentary on Al Gore\'s campaign to make the issue of global warming a recognized problem worldwide.','Won 2 Oscars. Another 21 wins & 5 nominations',NULL,100,'Color','1.85 : 1','PG','This is the first carbon-neutral documentary. NativeEnergy, which works with individuals and organizations to help them compensate for their contributions to global warming, calculated the \"carbon footprint\" from producing the film, including all travel, office, and accommodations related emissions. The company then offset emissions through renewable energy credits or \"green tags from new renewable energy projects. Paramount Classics and Participant will split the cost of these tags; the funds will go towards helping build new Native American, Alaskan Native Village, and farmer-owned renewable energy projects, creating sustainable economies for communities in need and diversifying our energy supply. As Participant founder Jeff Skoll explains: \"It would be ironic, not to mention wrong, if we added to the global warming that Al Gore warns about in his film. Plus, these renewable energy projects offer options that will decrease our demand for fossil fuels and otherwise would likely not happen without these kinds of investments.\" Participant, NativeEnergy and Warner Bros. partnered in a similar way on Stephen Gaghan\'s film, Syriana (2005), where 100% of the carbon dioxide emissions generated by the production were translated into investments into renewable energy. This follows on from the first \"carbon neutral\" film The Day After Tomorrow (2004), which director Roland Emmerich paid for out of his own pocket.','Factual errors: When Gore shows the slide of the ice core graph at the beginning of the movie (about 20 minutes in), the numbers on the y-axis are wrong - the average is at 0.5, and the negative numbers are flipped. This graph is correct in the book; the slide is wrong and therefore misleading.'),('689164a29aa1cb4050b6661a98abd833',47296,'On the Waterfront',1954,'http://ia.media-imdb.com/images/M/MV5BMTQ4MDIxNTk4OF5BMl5BanBnXkFtZTcwNDIwMTAzMQ@@._V1._SX96_SY140_.jpg','/rg/photos-title/publicity-1/media/rm495228928/tt0047296','/video/screenplay/vi3081634073/',0.84,37336,NULL,NULL,NULL,'1955-01-14','14 January 1955','The Man Lived by the Jungle Law of the Docks!','An ex-prize fighter turned longshoreman struggles to stand up to his corrupt union bosses.','Won 8 Oscars. Another 16 wins & 7 nominations','The Hook (USA) (working title)',108,'Black and White','1.85 : 1','Approved','Marlon Brando objected to certain aspects in the famous taxicab scene. When filming began, Brando began to improvise some dialogue, surprising Rod Steiger. After a while, Elia Kazan told Brando to \"knock it off\". The problem Brando had with the scene, as he explained to screenwriter Budd Schulberg and Kazan, was that he felt he (as Terry Malloy) would have difficulty trying to talk reasonably with his brother (played by Steiger) with a gun at his ribs. At this, Kazan agreed and told Brando to improvise. Kazan maintained that he did not direct Brando nor Steiger in this scene, he simply stood back and let the two actors direct themselves.','Continuity: The framed photo of Lee J. Cobb as Johnny Friendly glad-handing an unidentified politician or mobster shows up both in the Longshoreman\'s Union headquarters on the docks and also in the Friendly bar, when Terry Malloy throws his gun at and breaks.'),('68a9d1d665719a59691b086592f3f427',68646,'The Godfather',1972,'http://ia.media-imdb.com/images/M/MV5BMTc2Nzc3MzQ4NV5BMl5BanBnXkFtZTYwMjQ5Mjc5._V1._SX100_SY123_.jpg','/rg/photos-title/still_frame-1/media/rm630888448/tt0068646',NULL,0.92,37552