.'),('999afc435d245ad252dc9ee20329c6ad',99685,'Goodfellas',1990,'http://ia.media-imdb.com/images/M/MV5BMjU3MTQ4OTA0MV5BMl5BanBnXkFtZTYwNjAyMDg4._V1._SX100_SY139_.jpg','/rg/photos-title/poster-1/media/rm585210368/tt0099685','/video/screenplay/vi2863268121/',0.88,206392,NULL,NULL,NULL,'1990-09-12','12 September 1990','As far back as I can remember, I\'ve always wanted to be a gangster.\" -- Henry Hill, Brooklyn, N.Y. 1955.','Henry Hill and his friends work their way up through the mob hierarchy.','Won Oscar. Another 34 wins & 18 nominations','Good Fellas (USA) (original script title)@#@GoodFellas (USA) (promotional title (video box title) (poster title))@#@Wiseguy (USA) (working title)',146,'Color (Technicolor)','1.85 : 1','R','The MPAA ordered 10 frames of blood removed from the film before granting it an \'R\' rating.','Incorrectly regarded as goofs: During the \"You\'re a funny guy\" scene (set in 1963), a bottle of Crown Royal whisky can be seen on the table. Crown Royal wasn\'t introduced for sale until 1965. Tommy smuggled Crown Royal into the States before it was legally imported.'),('9a9365756998380ffc0cd8e2c9995d6b',410975,'Desperate Housewives',2004,'http://ia.media-imdb.com/images/M/MV5BMTU2NDQ5MzUyNV5BMl5BanBnXkFtZTcwNTY2NTk4Mg@@._V1._SX100_SY133_.jpg','/rg/photos-title/still_frame-1/media/rm664243712/tt0410975','/video/hulu/vi2413757465/',0.80,20230,1,NULL,NULL,'2005-09-08','8 September 2005','Tempting, isn\'t it?','Secrets and truths unfold through the lives of female friends in one suburban neighborhood, after the mysterious suicide of a neighbor.','Won 3 Golden Globes. Another 38 wins & 106 nominations',NULL,45,'Color','1.33 : 1','TV-14','Calista Flockhart, Heather Locklear, and Mary-Louise Parker were considered for the role of Susan. Courteney Cox was also considered for the role of Susan. Marc Cherry didn\'t ask her because at the time she was pregnant with her daughter Coco and had expressed interest in taking some time off to raise the baby.','Err