tman Begins: The IMAX Experience (USA) (IMAX version)@#@Batman: Intimidation (USA) (original script title)@#@The Intimidation Game (USA) (fake working title)',140,'Color','2.35 : 1','PG-13','In the movie, Bruce Wayne is shown arriving at a fancy hotel in a Lamborghini Murciélago. The word \"murciélago\" is Spanish for bat (although the car itself was named after a prized bull owned by Don Antonio Miura, who had nothing to do with bats).','Continuity: During the roof jump part of the Batmobile chase there is a police officer who orders batman not to move on the bullhorn. He is the same actor that later delivers the line \'Can you at least tell me what it looks like?\' as the Batmobile whizzes past him.'),('a767cd795bd9e3bd8a38aa019813c2fd',45152,'Singin\' in the Rain',1952,'http://ia.media-imdb.com/images/M/MV5BMTkxODE1OTE2Nl5BMl5BanBnXkFtZTYwNzMwMDk5._V1._SX90_SY140_.jpg','/rg/photos-title/poster-1/media/rm434477568/tt0045152','/video/screenplay/vi3399746841/',0.84,50606,NULL,NULL,NULL,'1953-09-11','11 September 1953','Singin\' Swingin\' Glorious Feelin\' Technicolor Musical','A silent film production company and cast make a difficult transition to sound.','Nominated for 2 Oscars. Another 3 wins & 7 nominations',NULL,103,'Color (Technicolor) | Black and White','1.37 : 1','Approved','Gene Kelly had a 103-degree fever when he danced to the title song. The director wanted to send him home, and film the scene another day, but Kelly wouldn\'t hear of it. He eventually convinced the director that the massive preparations would be wasted, and to allow at least one take. That\'s all it took - one take - and Kelly went home to recuperate. Most of Kelly\'s performance is ad libbed - they only had time to rough out his motion up and down the street to establish camera shot opportunities; Kelly\'s health was deteriorating and they had to begin filming quickly.','Errors made by characters (possibly deliberate errors by the filmmakers): In Don Lockwood\'s film \"The Royal Rascals\" his character is seen pushing a man into a moat. Later when he jumps down to the same spot, it has become a cobblestone street.'),('a776f8f18d3915a7fa976d7f39cfc110',83658,'Blade Runner',1982,'http://ia.media-imdb.com/images/M/MV5BMTkxNTQ5NTI0Ml5BMl5BanBnXkFtZTYwODgzMDc4._V1._SX91_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm3320748288/tt0083658','/video/imdb/vi531759385/',0.83,171669,NULL,NULL,NULL,'1982-09-15','15 September 1982','A Futuristic Vision Perfected [2007 Final Cut]','Deckard, a blade runner, has to track down and terminate 4 replicants who hijacked a ship in space and have returned to earth seeking their maker.','Nominated for 2 Oscars. Another 9 wins & 14 nominations','Blade Runner: The Final Cut (International: English title) (recut version)',117,'Color (Technicolor)','2.20 : 1','R','Towards the end of principal photography an incident occurred which has become known as the T-shirt war. The majority of the crew didn\'t enjoy working on the film, and didn\'t like working for Ridley Scott, who they considered to be cold and distant. In an article in the British press, Scott commented that he preferred working with English crews because when he asked for something they would say, \"Yes gov\'nor\" and go get it, but things weren\'t that simple with American crews. Makeup supervisor Marvin G. Westmore saw the article and was disgusted. In retaliation, he had t-shirts printed with \"Yes gov\'nor my ass!\" on the front, and either Will Rogers never met Ridley Scott\" or \"You soar with eagles when you fly with turkeys\" on the back. In retaliation, Scott and several of his closer collaborators had t-shirts made with \"Xenophobia sucks\" on them.','Continuity: The positions of the chess pieces on Sebastian\'s board does not match the positions on Tyrell\'s board.'),('aa2f8168e3a3bb46b5c7200d8f1ba7ed',69281,'Sleuth',1972,'http://ia.media-imdb.com/images/M/MV5BMTMzODk1MDY3NV5BMl5BanBnXkFtZTcwMzAwNTcxMQ@@._V1._SX100_SY139_.jpg','/rg/photos-title/produ