e did.','Nominated for Oscar. Another 2 wins & 9 nominations',NULL,119,'Black and White | Color','1.85 : 1','R','Edward Norton was said to have re-edited the film to lengthen his screen time. Director Tony Kaye then attempted to get his name removed but violated a Directors\' Guild of America rule that states that directors that use pseudonyms (such as \"Alan Smithee\") must not talk about why they had their name removed - which Tony Kaye had done in ads in Variety. Kaye sued the DGA and New Line Cinema for $200 million stating that the DGA rule violated his first amendment rights.','Continuity: When Danny is hanging around the basketball courts, his backpack slides off his shoulder onto the ground. In the next shot, it is back on his shoulder.'),('b02ae316788e100ecb7b5e88a3793a8d',72890,'Dog Day Afternoon',1975,'http://ia.media-imdb.com/images/M/MV5BMTk1OTk2MTk2MF5BMl5BanBnXkFtZTcwMTQ3NjIzMQ@@._V1._SX100_SY113_.jpg','/rg/photos-title/product-1/media/rm3654392832/tt0072890','/video/screenplay/vi2633171737/',0.82,53717,NULL,NULL,NULL,'1976-01-30','30 January 1976','The robbery should have taken 10 minutes. 4 hours later, the bank was like a circus sideshow. 8 hours later, it was the hottest thing on live T.V. 12 hours later, it was all history. And it\'s all true','A man robs a bank to pay for his lover\'s operation; it turns into a hostage situation and a media circus.','Won Oscar. Another 10 wins & 17 nominations',NULL,125,'Color (Technicolor)','1.33 : 1','R','Because of the outrageous quality of the real life story, director Lumet deliberately chose not to look at any of the footage of what actually happened that day. For that same reason, he decided not to use any of the real Sonny and Leon\'s wedding film footage as it was so over the top, it would have alienated viewers.','Continuity: After talking to Leon, Sonny hangs the phone up and puts his hand on his head. When seen from the front, his hands are not on his head.'),('b006b9c88385c9f832cbfb2054b1f369',52618