eing there is all of it!','Chance, a simple gardener, has never left the estate until his employer dies. His simple TV-informed utterances are mistaken for profundity.','Won Oscar. Another 10 wins & 10 nominations','Chance',130,'Color (Technicolor)','1.85 : 1','PG','The Mansion used in the movie was The Biltmore Mansion in North Carolina.','Factual errors: When Chance is watching himself on the large screen in the store window display, he uses his home remote control to try and change the channels on that set, but it controls another TV instead. However the remote is of the earlier \"ultrasonic\" technology, and these sound waves DO NOT pass through glass at the required strength needed to work. Those of us born before the movie can recall that jiggling your keys would make a remote controlled TV unwittingly change channels, or turn off and on. At about this same time the now common \"infrared\" RCs were coming out, albeit at outrageous prices. These signals CAN in effect pass through glass, despite some losses due to reflection. For the scene to be technically correct they should have used an IR remote, which would not make those \"ringing bell\" metallic sounds.'),('b5877848a3fd2c283de24491505f9d87',120815,'Saving Private Ryan',1998,'http://ia.media-imdb.com/images/M/MV5BMjg0NTMzNzc2MV5BMl5BanBnXkFtZTYwODI5MzU5._V1._SX93_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm2672330752/tt0120815','/video/imdblink/vi3331523609/',0.85,246601,NULL,NULL,NULL,'1998-09-30','30 September 1998','In the Last Great Invasion of the Last Great War, The Greatest Danger for Eight Men was Saving... One.','Following the Normandy Landings, a group of US soldiers go behind enemy lines to retrieve a paratrooper whose brothers have been killed in action.','Won 5 Oscars. Another 52 wins & 53 nominations',NULL,170,'Color (Technicolor)','1.85 : 1','R','The two \"German\" soldiers who are shot trying to surrender were speaking Czech. They were saying, \"Please don\'t shoot me, I am not German, I am Czech, I didn\'t kill anyone, I am Czech!\" They were members of what the Germans called Ost [East] Battalions, men - mostly Czech and Polish - taken prisoner in eastern European countries invaded by Germany and forced into the German army.','Revealing mistakes: When the big soldier is first seen approaching Cpt. Miller as he is calling Ryan, he is a few yards away from him. In the next shot where he calls Joe, he is approaching from the same distance as the previous shot.'),('b5b67470fce51377a5200ba1753c2025',923752,'The King of Kong',2007,'http://ia.media-imdb.com/images/M/MV5BMTc5MzU3NTkzMl5BMl5BanBnXkFtZTcwMDQwNzE1MQ@@._V1._SX95_SY140_.jpg','/rg/photos-title/publicity-1/media/rm1662031872/tt0923752','/video/screenplay/vi3774087449/',0.83,12634,NULL,NULL,NULL,'2008-02-28','28 February 2008','Don\'t get chumpatized.','Diehard video game fans compete to break World Records on classic arcade games.','4 wins & 3 nominations','The King of Kong: A Fistful of Quarters (USA) (new title)',79,'Color','1.85 : 1','PG-13','Several of those depicted in the documentary, including Wiebe and Mitchell themselves, claim that it does not accurately depict events. For example, Wiebe and Mitchell were, and still are, on much friendlier terms than is suggested, and another player\'s record was in place during some of the events but is omitted. The director has conceded to many of these claims in statements, arguing that the fictionalized account is more entertaining.','Incorrectly regarded as goofs: The Donkey Kong cabinet that Steve Wiebe installs in his garage is a combo Donkey Kong/Donkey Kong Jr. cabinet, however the markings on the cabinet are those of a stand-alone Donkey Kong Jr. cabinet. Wiebe specially purchases and installs the \"brains\" (PCB) of the combo game into his Donkey Kong Jr. cabinet in the course of the movie.'),('b56c71def1770234483a7ca5a62cf7a6',469494,'There Will Be Blood',2007,'http://ia.media-imdb.com/images/M/MV5BMTgxNzEyNzE2NF5BMl5BanBnXkFtZTcwMjc2