e covered by Joe and Simon in their last day on the West face), Buhler/Price continued directly upwards on steep mixed ground where Yates/Simpson had moved right, over an ice rib, and into the huge, right slanting gully fanning open towards the top. This route led directly to what arguably was the true summit, a point that appears higher than the southern tip of the ridge. This new direct variant (humorously named \"Avoiding The Touch\") led straight up to this summit, and was more technically difficult but safer. Once on top of the peak, they left their rucksacks and traversed on easy terrain along the airy ridge to the south until they stood on the point Simpson/Yates considered the top, the point where the ridge dropped off very steeply towards Siula Chico. They then retraced their footsteps back to their first \"summit\" and continued northwards along the same ridge that Simpson/Yates had descended. However, after descending several hundred horizontal meters and enduring a sixth bivouac (on this airy ridge) Buhler/Price decided to rappel directly down the West Face instead of continuing North along the very exposed and corniced ridge. After 20 sixty meter rappels, they rappelled over the bergshrund about 2-300 meters north of where Joe had been dropped into the bergshrund when Simon had cut the rope. Buhler/Price had deep respect for the route of descent that the two Brits had negotiated and were in awe of their ability to descend it in the condition they were in.','Audio/visual unsynchronized: After Joe pulls the rope completely down while in the crevasse, the cut rope end is frayed. Later when looking at the rope end again, it\'s a nice clean cut.'),('c854067b258e5d83391a71a8befb5ff5',113247,'La haine',1995,'http://ia.media-imdb.com/images/M/MV5BMTc1ODkwNTI0OV5BMl5BanBnXkFtZTcwNDA2MjEyMQ@@._V1._SX100_SY140_.jpg','/rg/photos-title/poster-1/media/rm4092041728/tt0113247','/video/imdblink/vi2314535961/',0.81,25362,NULL,NULL,NULL,'1995-05-31','31 May 1995','Three Young Friends... One Last Chance.','Abdel, a local hoodlum, is hospitalized after a riot, where a policeman lost his gun. His friend Vinz finds it and claims he will kill a cop if Abdel dies.','8 wins & 11 nominations','La haine (UK) (USA)@#@Droits du cité (France) (working title)@#@The Hate (International: English title)',96,'Color | Black and White','1.85 : 1','R','Mathieu Kassovitz was inspired to write the screenplay when one of his friends - a fellow kid from the projects - died in police custody.',NULL),('c9b31cbb944bc3cd954e434c838f62f6',119488,'L.A. Confidential',1997,'http://ia.media-imdb.com/images/M/MV5BMTY3MzQ0ODIxOF5BMl5BanBnXkFtZTcwODQ5NzYxMQ@@._V1._SX100_SY133_.jpg','/rg/photos-title/publicity-1/media/rm730962432/tt0119488','/video/screenplay/vi1124073497/',0.84,152606,NULL,NULL,NULL,'1997-10-08','8 October 1997','Off the record, on the QT, and very hush-hush...','A shooting at an all night diner is investigated by three LA policemen in their own unique ways.','Won 2 Oscars. Another 69 wins & 43 nominations',NULL,138,'Color (Technicolor)','2.35 : 1','R','According to an Australian radio interview with Guy Pearce, the role of Lynn Bracken was offered to Jennifer Jason Leigh, who turned it down because she had already played a few prostitutes.','Incorrectly regarded as goofs: The phone number of Fleur-de-Lis is CRestview 2239. At the time, Los Angeles was using a mixture of phone numbers with 4 and 5 digits after the exchange (what today we would call 6 and 7 digit phone numbers).'),('c97ad0bc508c4cae9f17433bd54b1741',12349,'The Kid',1921,'http://ia.media-imdb.com/images/M/MV5BMTI3OTgxMDI3Nl5BMl5BanBnXkFtZTcwMzUwMjUyMQ@@._V1._SX100_SY115_.jpg','/rg/photos-title/product-1/media/rm1724554240/tt0012349',NULL,0.83,11927,NULL,NULL,NULL,'1921-02-06','6 February 1921','This is the great film he has been working on for a whole year','The Tramp cares for an abandoned child, but events put that relationship in jeopardy.',NULL,NULL,68,'Black and White','1.33 : 1',N