again.'),('cc6f61995769fe670cda824efdf4560c',47478,'Shichinin no samurai',1954,'http://ia.media-imdb.com/images/M/MV5BNzg5Mzk5Nzc0NF5BMl5BanBnXkFtZTcwNjg3MDQzMQ@@._V1._SX99_SY140_.jpg','/rg/photos-title/product-1/media/rm864980480/tt0047478','/video/screenplay/vi897712409/',0.88,88386,NULL,NULL,NULL,'1955-11-30','30 November 1955','The Mighty Warriors Who Became the Seven National Heroes of a Small Town','A poor village under attack by bandits recruits seven unemployed samurai to help them defend themselves.','Nominated for 2 Oscars. Another 4 wins & 5 nominations','Seven Samurai (UK) (USA)@#@Shichi-nin no samurai (Japan) (alternative transliteration)',207,'Black and White','1.37 : 1','Unrated','Early in the writing process, six of the samurai were conceptualized, all loosely based on historic figures. Originally Toshirô Mifune was meant to play Kyuzo, the extremely stoic master swordsman. However, Kurosawa and his collaborating writers decided that they needed a character they could more identity with who wasn\'t a fully-fledged samurai, so Kikuchiyo was created. Since Kikuchiyo didn\'t have a historic basis, Mifune was allowed, for a Kurosawa film, to do an unprecedented amount of improvisation in the part.','Audio/visual unsynchronized: When samurai or bandits are shot with muskets, the bullet strikes before the sound of the distant gunshot is heard. This is technically correct and it is a feature of other Kurosawa films, such as Kagemusha, although it gives the false impression that people are being shot before the guns are discharged.'),('cd918b007ed5b9b6490d7790a22d9156',73195,'Jaws',1975,'http://ia.media-imdb.com/images/M/MV5BMTA4NDA4NjE2OTdeQTJeQWpwZ15BbWU3MDYyMjA2MjE@._V1._SX99_SY140_.jpg','/rg/photos-title/behind_the_scenes-1/media/rm2240256000/tt0073195','/video/screenplay/vi3207267097/',0.83,126244,NULL,NULL,NULL,'1976-01-01','1 January 1976','The Nation\'s No.1 Best-Selling Book now the Screen\'s Super-Thriller','When a gigantic great white shark begins