 but lost when the court decided that the western gunfighter\'s persona, characterized by the costume and mannerisms, belonged to the public domain\'s folklore.','Continuity: The orientation of the match that Mortimer lights on Wild\'s hump.'),('d0fb2f3304d16ad64e6ac6d35cb01f8d',97576,'Indiana Jones and the Last Crusade',1989,'http://ia.media-imdb.com/images/M/MV5BMTkzODA5ODYwOV5BMl5BanBnXkFtZTcwMjAyNDYyMQ@@._V1._SX96_SY140_.jpg','/rg/photos-title/still_frame-1/media/rm82942208/tt0097576','/video/imdblink/vi3030123545/',0.83,158574,NULL,NULL,NULL,'1989-10-18','18 October 1989','He\'s back in an all new adventure. Memorial Day 1989.','When Dr. Henry Jones Sr. suddenly goes missing while pursuing the Holy Grail, eminent archaeologist Indiana Jones must follow in his father\'s footsteps and stop the Nazis.','Won Oscar. Another 4 wins & 17 nominations',NULL,127,'Color','1.33 : 1','E','Harrison Ford and Sean Connery passed up three subsequent opportunities to work together. Connery accepted a role in The Hunt for Red October (1990), while Ford declined the role of Jack Ryan, which went to Alec Baldwin instead. Ford later took over the role in Patriot Games (1992). Ford and Connery both declined the roles of Alan Grand and John Hammond, respectively, in Spielberg\'s Jurassic Park (1993). Connery declined to return to the role of Henry Jones in Indiana Jones and the Kingdom of the Crystal Skull (2008).','Continuity: When Indy, Elsa, and Brody are walking to the library, Indy is wearing his hat, but inside the library, Indy\'s hat has disappeared and he is not holding it in his hand.'),('d09e52c6f58394c4ce6922673b37d22c',88763,'Back to the Future',1985,'http://ia.media-imdb.com/images/M/MV5BMTkzNDQyMjc0OV5BMl5BanBnXkFtZTcwNDQ4MDYyMQ@@._V1._SX100_SY133_.jpg','/rg/photos-title/still_frame-1/media/rm912824576/tt0088763','/video/screenplay/vi2562195737/',0.84,180999,NULL,NULL,NULL,'1985-10-30','30 October 1985','He\'s the only kid ever to get into trouble before he was born. [UK]','In 1985, Doc Brown invents time travel; in 1955, Marty McFly accidentally prevents his parents from meeting, putting his own existence at stake.','Won Oscar. Another 13 wins & 23 nominations',NULL,116,'Color (Technicolor)','1.37 : 1','PG','Universal Pictures head Sid Sheinberg did not like the title \"Back to the Future\", insisting that nobody would see a movie with \"future\" in the title. In a memo to Robert Zemeckis, he said that the title should be changed to \"Spaceman From Pluto\", tying in with the Marty-as-alien jokes in the film, and also suggested further changes like replacing the \"I\'m Darth Vader from planet Vulcan\" line with \"I am a spaceman from Pluto!\" Sheinberg was persuaded to change his mind by a response memo from Steven Spielberg, which thanked him for sending a wonderful \"joke memo\", and that everyone got a kick out of it. Sheinberg, too proud to admit he was serious, gave in to letting the film retain its title.','Plot holes: Although Doc Brown would have been able to tell exactly which minute lightning would strike the clock tower (from the photograph in the flier), he would not have been able to determine which second - yet he implies that he knows when he puts the alarm clock in the time machine.'),('d26e3560f660770484652e3221026c6c',248654,'Six Feet Under',2001,'http://ia.media-imdb.com/images/M/MV5BMjEzMzc2NjA5NV5BMl5BanBnXkFtZTcwOTI1MDAzMQ@@._V1._SX100_SY136_.jpg','/rg/photos-title/still_frame-1/media/rm3469449472/tt0248654','/video/screenplay/vi2609381657/',0.93,17274,1,NULL,NULL,'2001-12-06','6 December 2001','Every Day Above Ground Is A Good One.','A drama series that takes a darkly comical look at members of a dysfunctional California family that runs an independent funeral home.','Won 3 Golden Globes. Another 43 wins & 117 nominations',NULL,55,'Color','1.33 : 1','TV-MA','Set in Los Angeles because, according to series creator Alan Ball, LA is the \"world capital of the denial of death\".',NULL),('d2e45e3266d3107deb258963